import React, { Component } from "react";
import Carousel from "react-elastic-carousel";
import "./App.css";
import Card from "./Components/Card";
//import Desktop from "./Components/Desktop";
//import Card from "./Components/Card";

class App extends Component {
  render() {
    return (
      <div className="App">
        <div className="grid">
          <div className="card1 card">
            <h2
              style={{
                backgroundImage:
                  'url("https://media.geeksforgeeks.org/' +
                  'wp-content/uploads/20201221222410/download3.png")',
                height: "300px",
                backgroundRepeat: "no-repeat",
              }}></h2>
          </div>
          <div className="card2 card">2</div>
          <div className="card3 card">3</div>
          <div className="card4 card">4</div>
          <div className="card5 card">5</div>
          <div className="card6 card">6</div>
        </div>
        <Carousel>
          <Card />
          <Card />
          <Card />
          <Card />
          <Card />
        </Carousel>
      </div>
    );
  }
}

export default App;
